def avg_loss_for_dataset(test,test_predictions):
    counter = 0
    summ = 0
    for item in test['Target']:
        loss = abs(item - test_predictions[counter])
        summ += loss 
        counter +=1
    avg_loss = summ/counter
    return avg_loss


